import React, { Component } from 'react';
import { Container, Avatar, Typography, TextField, Button } from '@material-ui/core';
import styleForm from '../estilos/estiloForm';
import Icono from "@material-ui/icons/LockOutlined";

class Login extends Component {
    render() {
        return (
            <Container maxWidth="xs">
                <div style={styleForm.paper}>
                    <Avatar style={styleForm.Avatar}>
                        <Icono></Icono>
                    </Avatar>
                    <Typography component="h1" variant="h5">Ingresa tus datos</Typography>
                    <form style={styleForm.formulario}>
                        <TextField variant="outlined" fullWidth label="Correo" name="correo" margin="normal"/>
                        <TextField variant="outlined" fullWidth label="Contraseña" margin="normal" type="password" name="contraseña"/>
                        <Button fullWidth variant="contained">Iniciar</Button>
                    </form>
                </div>
            </Container>
        );
    }
}

export default Login;
